import React, { Component } from 'react'
import Table from './Table'

class App extends React.Component {
    render() {
      const characters = [
        {
          name: 'Charlie',
          job: 'Frontend Engineer'
        },
        {
          name: 'Bob',
          job: 'Backend Engineer'
        }
      ]
      return (
          <div className="container">
            <Table characterData={characters}/>
          </div>
      )
    }
  }

  export default App
